import React from 'react';
import './App.css'; // Assuming you have a separate CSS file for styling
import Card from './Components/Card'; // Import the Card component
import BarChart from './Components/BarChart'; // Import the chart components
import LineChart from './Components/LineChart';
import PieChart from './Components/PieChart';
import { UserData } from './Data';

function App() {
  const [userData, setUserData] = React.useState({
    labels: UserData.map((data) => data.year),
    datasets: [
      {
        label: 'Users Gained',
        data: UserData.map((data) => data.userGain),
        backgroundColor: [
          'rgba(75,192,192,1)',
          '#ecf0f1',
          '#50AF95',
          '#f3ba2f',
          '#2a71d0',
        ],
        borderColor: 'black',
        borderWidth: 2,
      },
    ],
  });

  const DonorData = {
    labels: userData.labels,
    datasets: [
      {
        label: 'Number of Donors',
        data: UserData.map((data) => data.Donor),
        backgroundColor: 'rgba(255,99,132,1)',
        borderColor: 'black',
        borderWidth: 2,
      },
    ],
  };

  const RecepientData = {
    labels: userData.labels,
    datasets: [
      {
        label: 'Number of Donors',
        data: UserData.map((data) => data.Recepient),
        backgroundColor: 'rgba(255,99,132,1)',
        borderColor: 'black',
        borderWidth: 2,
      },
    ],
  };

  const Card = ({ title, content }) => {
    return (
      <div className="card">
        <div className="card-content">
          <h2>{title}</h2>
          <p>{content}</p>
        </div>
      </div>
    );
  };

  const totalRows = 2;
  const cardsPerRow = 4;
  const totalCards = totalRows * cardsPerRow;

  const renderCards = () => {
    const cards = [];
    cards.push(<Card key={0} title="A+" content="Units available : 10" />);
    cards.push(<Card key={1} title="A-" content="Units available : 16" />);
    cards.push(<Card key={2} title="B+" content="Units available : 78" />);
    cards.push(<Card key={3} title="B-" content="Units available : 45" />);
    cards.push(<Card key={4} title="AB+" content="Units available : 32" />);
    cards.push(<Card key={5} title="AB-" content="Units available : 76" />);
    cards.push(<Card key={6} title="O+" content="Units available : 32" />);
    cards.push(<Card key={7} title="O-" content="Units available : 89" />);

    return cards;
  };

  return (
    <>
      <h1 style={{ textAlign: 'center' }}>Blood Donation Statistics</h1>

      <div className="App">

        <div className='cardContainer'>
          <div className='card'>
            <Card title="Bar Chart" content="Age Distribution of Donors">
              <BarChart chartData={userData} />
            </Card>
          </div>
          <div className='card'>
            <Card title="Pie Chart" content="This is a pie chart">
              <PieChart chartData={userData} />
            </Card>
          </div>

        </div>
        <div className='cardContainer'>
          <div className='card'>
            <Card title="Line Chart" content="Year Wise Recepients">
              <LineChart chartData={RecepientData} />
            </Card>
          </div>
          <div className='card'>
            <Card title="Line Chart" content="Year Wise Donors">
              <LineChart chartData={DonorData} />
            </Card>
          </div>


        </div>



      </div>

      <div>



      </div>
    </>

  );
}

export default App;
